import React from "react";
import Layout from "../../../Common/Component/Layout";
import mainImg1 from "../../../Image/event6result1.png";
import mainImg2 from "../../../Image/event6result2.png";
import mainImg3 from "../../../Image/event6result3.png";
import mainImg4 from "../../../Image/event6result4.png";
import "./index.scss";

export default function View(props) {
  return (
    <Layout>
      <div className="eventEnd6">
        <img className="ev6ResultImg" src={mainImg1} alt="result1" />
        <img className="ev6ResultImg" src={mainImg2} alt="result2" />
        <img className="ev6ResultImg" src={mainImg3} alt="result3" />
        <img className="ev6ResultImg" src={mainImg4} alt="result4" />
      </div>
    </Layout>
  );
}
